import React from "react";
import {Button, Drawer, useDisclosure} from "@chakra-ui/react";

function CountryLeagues(){
    const { isOpen, onOpen, onClose } = useDisclosure();
    const buttonCall = React.useRef()

    return(
        <>
        <Button bg='transparent'  color='#7b7b7b' mt='50px' ref={buttonCall}> Country or League </Button>
        <Drawer
            isOpen={isOpen}
            placement='right'
            onClose={onClose}
            finalFocusRef={buttonCall}
        >

        </Drawer>
        </>
    )
}

export default CountryLeagues
